import React from 'react'
import Header from './Grids/Header'

function App() {
  return (
    <div className="App">
      <div className='container'>
        <div className='headerRaw'><Header /></div>
        <div className='interactionRaw'></div>
      </div>
    </div>
  );
}

export default App;
